 <div className="col-lg-4 col-lg-offset-4 col-md-8 col-md-offset-2 col-sm-8 col-sm-offset-2 col-xs-10 col-xs-offset-1 align-items-center text-justify footer-custom-nav" >

<div className="d-flex bd-highlight  ">
  <div className="p-2 flex-fill bd-highlight" style={{textAlign:"center"}}>Flex item</div>
